// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract CPAMM {
    IERC20 public immutable token0;
    IERC20 public immutable token1;

    uint256 public reserve0;
    uint256 public reserve1;

    uint256 public totalSupply;

    mapping(address => uint256) public sharesHeld;

    constructor(address _token0, address _token1) {
        token0 = IERC20(_token0);
        token1 = IERC20(_token1);
    }

    function mint(address _to, uint256 _amount) private {
        sharesHeld[_to] += _amount;
        totalSupply += _amount;
    }

    function burn(address _from, uint256 _amount) private {
        sharesHeld[_from] -= _amount;
        totalSupply += _amount;
    }

    function updateReserves(uint256 _reserve0, uint256 _reserve1) private {
        reserve0 = _reserve0;
        reserve1 = _reserve1;
    }

    function addLiquidity(uint256 _amount0, uint256 _amount1) external {
        require(
            token0.allowance(msg.sender, address(this)) >= _amount0
                && token1.allowance(msg.sender, address(this)) >= _amount1,
            "CPAMM: NOT APPROVED"
        );
        // CHECK dy/dx = y/x
        if (reserve0 != 0 || reserve1 != 0) {
            require(_amount0 * reserve1 == _amount1 * reserve0, "CPAMM: SUPPLIED LIQUIDITY IS INVALID");
        }

        token0.transferFrom(msg.sender, address(this), _amount0);
        token1.transferFrom(msg.sender, address(this), _amount1);

        // CALCULATE SHARES
        uint256 shares;
        if (totalSupply == 0) {
            shares = sqrt(_amount0 * _amount1);
        } else {
            shares = min((_amount0 * totalSupply) / reserve0, (_amount1 * totalSupply) / reserve1);
        }
        require(shares > 0, "shares = 0");

        updateReserves(token0.balanceOf(address(this)), token1.balanceOf(address(this)));
        // UPDATE RESERVES
        reserve0 = reserve0 + _amount0;
        reserve1 = reserve1 + _amount1;

        mint(msg.sender, shares);
    }

    function removeLiquidity(uint256 shares) external {
        // CHECK VALID STATES
        require(sharesHeld[msg.sender] >= shares, "CPAMM: ADD LIQUIDITY FIRST");

        uint256 bal0 = token0.balanceOf(address(this));
        uint256 bal1 = token1.balanceOf(address(this));

        // CALCULATE OUT AMOUNT
        uint256 amount0 = (shares * bal0) / totalSupply;
        uint256 amount1 = (shares * bal1) / totalSupply;

        require(amount0 > 0 && amount1 > 0, "CPAMM: NO LIQUIDITY AVAILABLE IN THE POOL");

        burn(msg.sender, shares);
        updateReserves(bal0 - amount0, bal1 - amount1);

        // TRANSFER AND UPDATE STATES
        token0.transfer(msg.sender, amount0);
        token1.transfer(msg.sender, amount1);
    }

    function swap(address _token, uint256 _amount) external {
        require(_token == address(token0) || _token == address(token1), "CPAMM: INVALID TOKEN");
        require(_amount > 0, "CPAMM: AMOUNT HAS TO BE > 0");

        (IERC20 tokenIn, IERC20 tokenOut, uint256 reserveIn, uint256 reserveOut) =
            _token == address(token0) ? (token0, token1, reserve0, reserve1) : (token1, token0, reserve1, reserve0);

        tokenIn.transferFrom(msg.sender, address(this), _amount);

        // FEE IS 0.3
        uint256 amountWithoutFees = (_amount * 997) / 1000;

        // CALC dy = (y * dx) / (x + dx)
        uint256 amountOut = (amountWithoutFees * reserveOut) / (reserveIn + amountWithoutFees);
        tokenOut.transfer(msg.sender, amountOut);

        updateReserves(token0.balanceOf(address(this)), token1.balanceOf(address(this)));
    }

    // UTILITY FUNCTIONS
    function sqrt(uint256 x) private pure returns (uint256 y) {
        uint256 z = (x + 1) / 2;
        y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
    }

    function min(uint256 x, uint256 y) private pure returns (uint256) {
        return x >= y ? y : x;
    }
}
